iption of the warning code.", "type": "string" }, "data": { "items": { "properties": { "key": { "type": "string", "description": "[Output Only] A key that provides more detail on the warning being returned. For example, for warnings where there are no results in a list request for a particular zone, this key might be scope and the key value might be the zone name. Other examples might be a key indicating a deprecated resource and a suggested replacement, or a warning about invalid network settings (for example, if an instance attempts to perform IP forwarding but is not enabled for IP forwarding)." }, "value": { "type": "string", "description": "[Output Only] A warning data value corresponding to the key." } }, "type": "object" }, "description": "[Output Only] Metadata about this warning in key: value format. For example: \"data\": [ { \"key\": \"scope\", \"value\": \"zones/us-east1-d\" } ", "type": "array" } }, "type": "object" }, "unreachables": { "items": { "type": "string" }, "description": "[Output Only] Unreachable resources.", "type": "array" }, "nextPageToken": { "description": "[Output Only] This token allows you to get the next page of results for list requests. If the number of results is larger than maxResults, use the nextPageToken as a value for the query parameter pageToken in the next list request. Subsequent list requests will have their own nextPageToken to continue paging through the results.", "type": "string" }, "kind": { "default": "compute#futureReservationsListResponse", "type": "string", "description": "[Output Only] Type of resource.Always compute#FutureReservationsListResponse for lists of reservations" }, "items": { "description": "[Output Only] A list of future reservation resources.", "items": { "$ref": "FutureReservation" }, "type": "array" }, "selfLink": { "description": "[Output Only] Server-defined URL for this resource.", "type": "string" }, "etag": { "type": "string" } }, "type": "object", "id": "FutureReservationsListResponse" },