 must provide the encryption key when you create a disk from the encrypted snapshot in a future request. Customer-supplied encryption keys do not protect access to metadata of the snapshot. If you do not provide an encryption key when creating the snapshot, then the snapshot will be encrypted using an automatically generated key and you do not need to provide a key to use the snapshot later.", "$ref": "CustomerEncryptionKey" }, "creationSizeBytes": { "description": "[Output Only] Size in bytes of the snapshot at creation time.", "type": "string", "format": "int64" }, "sourceDisk": { "type": "string", "description": "The source disk used to create this snapshot." }, "kind": { "type": "string", "default": "compute#snapshot", "description": "[Output Only] Type of the resource. Always compute#snapshot for Snapshot resources." }, "sourceInstantSnapshotId": { "description": "[Output Only] The unique ID of the instant snapshot used to create this snapshot. This value identifies the exact instant snapshot that was used to create this persistent disk. For example, if you created the persistent disk from an instant snapshot that was later deleted and recreated under the same name, the source instant snapshot ID would identify the exact instant snapshot that was used.", "type": "string" }, "licenses": { "items": { "type": "string" }, "type": "array", "description": "[Output Only] A list of public visible licenses that apply to this snapshot. This can be because the original image had licenses attached (such as a Windows image)." }, "guestFlush": { "type": "boolean", "description": "[Input Only] Whether to attempt an application consistent snapshot by informing the OS to prepare for the snapshot process." }, "diskSizeGb": { "type": "string", "format": "int64", "description": "[Output Only] Size of the source disk, specified in GB." }, "labelFingerprint": { "description": "A fingerprint for the labels being applied to this snapshot, which is essentially a hash of the labels set 