icy overrides per-zone references to the image via the associated image family. The rollout policy restricts the zones where this image is accessible when using a zonal image family reference. When the rollout policy does not include the user specified zone, or if the zone is rolled out, this image is accessible. The rollout policy for this image is read-only, except for allowlisted users. This field might not be configured. To view the latest non-deprecated image in a specific zone, use the imageFamilyViews.get method.", "$ref": "RolloutPolicy" }, "status": { "type": "string", "enum": [ "DELETING", "FAILED", "PENDING", "READY" ], "description": "[Output Only] The status of the image. An image can be used to create other resources, such as instances, only after the image has been successfully created and the status is set to READY. Possible values are FAILED, PENDING, or READY.", "enumDescriptions": [ "Image is deleting.", "Image creation failed due to an error.", "Image hasn't been created as yet.", "Image has been successfully created." ] }, "kind": { "description": "[Output Only] Type of the resource. Always compute#image for images.", "default": "compute#image", "type": "string" }, "sourceSnapshot": { "description": "URL of the source snapshot used to create this image. The following are valid formats for the URL: - https://www.googleapis.com/compute/v1/projects/project_id/global/ snapshots/snapshot_name - projects/project_id/global/snapshots/snapshot_name In order to create an image, you must provide the full or partial URL of one of the following: - The rawDisk.source URL - The sourceDisk URL - The sourceImage URL - The sourceSnapshot URL ", "type": "string" }, "diskSizeGb": { "type": "string", "description": "Size of the image when restored onto a persistent disk (in GB).", "format": "int64" }, "description": { "type": "string", "description": "An optional description of this resource. Provide this property when you create the resource." }, "sourceDiskId": { 