r the disk is created. This includes a list of URLs to the license resource. For example, to provide a debian license: https://www.googleapis.com/compute/v1/projects/debian-cloud/global/licenses/debian-9-stretch ", "type": "array" }, "sourceSnapshotId": { "type": "string", "description": "[Output Only] The ID value of the snapshot used to create this image. This value may be used to determine whether the snapshot was taken from the current or a previous instance of a given snapshot name." }, "licenseCodes": { "type": "array", "items": { "type": "string", "format": "int64" }, "description": "Integer license codes indicating which licenses are attached to this image." }, "storageLocations": { "description": "Cloud Storage bucket storage location of the image (regional or multi-regional).", "type": "array", "items": { "type": "string" } }, "archiveSizeBytes": { "type": "string", "description": "Size of the image tar.gz archive stored in Google Cloud Storage (in bytes).", "format": "int64" }, "locked": { "description": "A flag for marketplace VM disk created from the image, which is designed for marketplace VM disk to prevent the proprietary data on the disk from being accessed unwantedly. The flag will be inherited by the disk created from the image. The disk with locked flag set to true will be prohibited from performing the operations below: - R/W or R/O disk attach - Disk detach, if disk is created via create-on-create - Create images - Create snapshots - Create disk clone (create disk from the current disk) The image with the locked field set to true will be prohibited from performing the operations below: - Create images from the current image - Update the locked field for the current image The instance with at least one disk with locked flag set to true will be prohibited from performing the operations below: - Secondary disk attach - Create instant snapshot - Create machine images - Create instance template - Delete the instance with --keep-disk parameter set to