ist of InstanceGroup resources.", "type": "object" }, "ConsistentHashLoadBalancerSettings": { "description": "This message defines settings for a consistent hash style load balancer.", "properties": { "httpCookie": { "description": "Hash is based on HTTP Cookie. This field describes a HTTP cookie that will be used as the hash key for the consistent hash load balancer. If the cookie is not present, it will be generated. This field is applicable if the sessionAffinity is set to HTTP_COOKIE. Not supported when the backend service is referenced by a URL map that is bound to target gRPC proxy that has validateForProxyless field set to true.", "$ref": "ConsistentHashLoadBalancerSettingsHttpCookie" }, "httpHeaderName": { "description": "The hash based on the value of the specified header field. This field is applicable if the sessionAffinity is set to HEADER_FIELD.", "type": "string" }, "minimumRingSize": { "type": "string", "description": "The minimum number of virtual nodes to use for the hash ring. Defaults to 1024. Larger ring sizes result in more granular load distributions. If the number of hosts in the load balancing pool is larger than the ring size, each host will be assigned a single virtual node.", "format": "int64" } }, "type": "object", "id": "ConsistentHashLoadBalancerSettings" }, "HelpLink": { "description": "Describes a URL link.", "properties": { "url": { "type": "string", "description": "The URL of the link." }, "description": { "type": "string", "description": "Describes what the link offers." } }, "id": "HelpLink", "type": "object" }, "AccessConfig": { "properties": { "setPublicPtr": { "type": "boolean", "description": "Specifies whether a public DNS 'PTR' record should be created to map the external IP address of the instance to a DNS domain name. This field is not used in ipv6AccessConfig. A default PTR record will be created if the VM has external IPv6 range associated." }, "externalIpv6": { "type": "string", "description": "The first IPv6 address of