t Only] The shared secret to be used for reverse DNS verification." }, "publicDelegatedPrefixs": { "description": "[Output Only] The list of public delegated prefixes that exist for this public advertised prefix.", "items": { "$ref": "PublicAdvertisedPrefixPublicDelegatedPrefix" }, "type": "array" }, "status": { "type": "string", "description": "The status of the public advertised prefix. Possible values include: - `INITIAL`: RPKI validation is complete. - `PTR_CONFIGURED`: User has configured the PTR. - `VALIDATED`: Reverse DNS lookup is successful. - `REVERSE_DNS_LOOKUP_FAILED`: Reverse DNS lookup failed. - `PREFIX_CONFIGURATION_IN_PROGRESS`: The prefix is being configured. - `PREFIX_CONFIGURATION_COMPLETE`: The prefix is fully configured. - `PREFIX_REMOVAL_IN_PROGRESS`: The prefix is being removed. ", "enumDescriptions": [ "The prefix is announced to Internet.", "RPKI validation is complete.", "The prefix is fully configured.", "The prefix is being configured.", "The prefix is being removed.", "User has configured the PTR.", "The prefix is currently withdrawn but ready to be announced.", "Reverse DNS lookup failed.", "Reverse DNS lookup is successful." ], "enum": [ "ANNOUNCED_TO_INTERNET", "INITIAL", "PREFIX_CONFIGURATION_COMPLETE", "PREFIX_CONFIGURATION_IN_PROGRESS", "PREFIX_REMOVAL_IN_PROGRESS", "PTR_CONFIGURED", "READY_TO_ANNOUNCE", "REVERSE_DNS_LOOKUP_FAILED", "VALIDATED" ] }, "fingerprint": { "format": "byte", "description": "Fingerprint of this resource. A hash of the contents stored in this object. This field is used in optimistic locking. This field will be ignored when inserting a new PublicAdvertisedPrefix. An up-to-date fingerprint must be provided in order to update the PublicAdvertisedPrefix, otherwise the request will fail with error 412 conditionNotMet. To see the latest fingerprint, make a get() request to retrieve a PublicAdvertisedPrefix.", "type": "string" }, "creationTimestamp": { "description": "[Output Only] Creation timestamp in RFC3339 text format.", "type": "string" }, "pdpScope": { "enum": [ "GLOBAL", "GLOBAL_AND_REGIONAL", "REGIONAL" ], "type": "string", "description": "Specifies how child public delegated prefix will be scoped. It could be one of following values: - `REGIONAL`: The public delegated prefix is regional only. The provisioning will take a few minutes. - `GLOBAL`: The public delegated prefix is global only. The provisioning will take ~4 weeks. - `GLOBAL_AND_REGIONAL` [output only]: The public delegated prefixes is BYOIP V1 legacy prefix. This is output only value and no longer supported in BYOIP V2. ", "enumDescriptions": [ "The public delegated prefix is global only. The provisioning will take ~4 weeks.", "The public delegated prefixes is BYOIP V1 legacy prefix. This is output only value and no longer supported in BYOIP V2.", "The public delegated prefix is regional only. The provisioning will take a few minutes." ] }, "dnsVerificationIp": { "type": "string", "description": "The IPv4 address to be used for reverse DNS verification." }, "description": { "description": "An optional description of this resource. Provide this property when you create the resource.", "type": "string" }, "kind": { "default": "compute#publicAdvertisedPrefix", "type": "string", "description": "[Output Only] Type of the resource. Always compute#publicAdvertisedPrefix for public advertised prefixes." }, "id": { "type": "string", "description": "[Output Only] The unique identifier for the resource type. The server generates this identifier.", "format": "uint64" }, "ipCidrRange": { "type": "string", "description": "The IPv4 address range, in CIDR format, represented by this public advertised prefix." }, "selfLink": { "type": "string", "description": "[Output Only] Server-defined URL for the resource." } }, "description": "A public advertised prefix represents an aggregated IP prefix or netblock which customers bring to cloud. The IP prefix is a single unit of route advertisement and is announced globally to the 