ast one of either maxSurge or maxUnavailable must be greater than 0. Learn more about maxSurge.", "$ref": "FixedOrPercent" }, "minimalAction": { "description": "Minimal action to be taken on an instance. Use this option to minimize disruption as much as possible or to apply a more disruptive action than is necessary. - To limit disruption as much as possible, set the minimal action to REFRESH. If your update requires a more disruptive action, Compute Engine performs the necessary action to execute the update. - To apply a more disruptive action than is strictly necessary, set the minimal action to RESTART or REPLACE. For example, Compute Engine does not need to restart a VM to change its metadata. But if your application reads instance metadata only when a VM is restarted, you can set the minimal action to RESTART in order to pick up metadata changes. ", "enum": [ "NONE", "REFRESH", "REPLACE", "RESTART" ], "type": "string", "enumDescriptions": [ "Do not perform any action.", "Updates applied in runtime, instances will not be disrupted.", "Old instances will be deleted. New instances will be created from the target template.", "Every instance will be restarted." ] }, "instanceRedistributionType": { "enumDescriptions": [ "No action is being proactively performed in order to bring this IGM to its target instance distribution.", "This IGM will actively converge to its target instance distribution." ], "enum": [ "NONE", "PROACTIVE" ], "type": "string", "description": "The instance redistribution policy for regional managed instance groups. Valid values are: - PROACTIVE (default): The group attempts to maintain an even distribution of VM instances across zones in the region. - NONE: For non-autoscaled groups, proactive redistribution is disabled. " }, "type": { "enum": [ "OPPORTUNISTIC", "PROACTIVE" ], "description": "The type of update process. You can specify either PROACTIVE so that the instance group manager proactively executes actions in order to bring instances to 