iption": "The name of the instance group. The name must be 1-63 characters long, and comply with RFC1035.", "pattern": "[a-z](?:[-a-z0-9]{0,61}[a-z0-9])?", "annotations": { "required": [ "compute.instanceGroups.insert" ] } }, "fingerprint": { "description": "[Output Only] The fingerprint of the named ports. The system uses this fingerprint to detect conflicts when multiple users change the named ports concurrently.", "type": "string", "format": "byte" }, "selfLink": { "description": "[Output Only] The URL for this instance group. The server generates this URL.", "type": "string" }, "description": { "description": "An optional description of this resource. Provide this property when you create the resource.", "type": "string" }, "namedPorts": { "items": { "$ref": "NamedPort" }, "description": " Assigns a name to a port number. For example: {name: \"http\", port: 80} This allows the system to reference ports by the assigned name instead of a port number. Named ports can also contain multiple ports. For example: [{name: \"app1\", port: 8080}, {name: \"app1\", port: 8081}, {name: \"app2\", port: 8082}] Named ports apply to all instances in this instance group. ", "type": "array" }, "region": { "description": "[Output Only] The URL of the region where the instance group is located (for regional resources).", "type": "string" }, "selfLinkWithId": { "type": "string", "description": "[Output Only] Server-defined URL for this resource with the resource id." }, "zone": { "description": "[Output Only] The URL of the zone where the instance group is located (for zonal resources).", "type": "string" }, "id": { "type": "string", "format": "uint64", "description": "[Output Only] A unique identifier for this instance group, generated by the server." }, "subnetwork": { "description": "[Output Only] The URL of the subnetwork to which all instances in the instance group belong. If your instance has multiple network interfaces, then the network and subnetwork fields only refer to the n