N", "UP" ], "description": "[Output Only] Status of the zone, either UP or DOWN." }, "selfLink": { "type": "string", "description": "[Output Only] Server-defined URL for the resource." }, "creationTimestamp": { "description": "[Output Only] Creation timestamp in RFC3339 text format.", "type": "string" }, "description": { "type": "string", "description": "[Output Only] Textual description of the resource." }, "name": { "description": "[Output Only] Name of the resource.", "type": "string" }, "deprecated": { "description": "[Output Only] The deprecation status associated with this zone.", "$ref": "DeprecationStatus" }, "id": { "type": "string", "format": "uint64", "description": "[Output Only] The unique identifier for the resource. This identifier is defined by the server." }, "availableCpuPlatforms": { "type": "array", "description": "[Output Only] Available cpu/platform selections for the zone.", "items": { "type": "string" } } }, "description": "Represents a Zone resource. A zone is a deployment area. These deployment areas are subsets of a region. For example the zone us-east1-a is located in the us-east1 region. For more information, read Regions and Zones.", "id": "Zone", "type": "object" }, "RouterBgpPeer": { "properties": { "ipv6NexthopAddress": { "description": "IPv6 address of the interface inside Google Cloud Platform.", "type": "string" }, "advertisedIpRanges": { "description": "User-specified list of individual IP ranges to advertise in custom mode. This field can only be populated if advertise_mode is CUSTOM and overrides the list defined for the router (in the \"bgp\" message). These IP ranges are advertised in addition to any specified groups. Leave this field blank to advertise no custom IP ranges.", "type": "array", "items": { "$ref": "RouterAdvertisedIpRange" } }, "advertisedRoutePriority": { "format": "uint32", "type": "integer", "description": "The priority of routes advertised to this BGP peer. Where there is more than one matching route of maxi