hen you create the resource." }, "service": { "type": "string", "description": "URL to the BackendService resource." } }, "description": "Represents a Target SSL Proxy resource. A target SSL proxy is a component of a SSL Proxy load balancer. Global forwarding rules reference a target SSL proxy, and the target proxy then references an external backend service. For more information, read Using Target Proxies.", "type": "object" }, "AutoscalingPolicyLoadBalancingUtilization": { "description": "Configuration parameters of autoscaling based on load balancing.", "type": "object", "properties": { "utilizationTarget": { "description": "Fraction of backend capacity utilization (set in HTTP(S) load balancing configuration) that the autoscaler maintains. Must be a positive float value. If not defined, the default is 0.8.", "format": "double", "type": "number" } }, "id": "AutoscalingPolicyLoadBalancingUtilization" }, "DiskType": { "id": "DiskType", "type": "object", "properties": { "id": { "format": "uint64", "type": "string", "description": "[Output Only] The unique identifier for the resource. This identifier is defined by the server." }, "name": { "type": "string", "pattern": "[a-z](?:[-a-z0-9]{0,61}[a-z0-9])?", "description": "[Output Only] Name of the resource." }, "selfLink": { "type": "string", "description": "[Output Only] Server-defined URL for the resource." }, "validDiskSize": { "description": "[Output Only] An optional textual description of the valid disk size, such as \"10GB-10TB\".", "type": "string" }, "selfLinkWithId": { "description": "[Output Only] Server-defined URL for this resource with the resource id.", "type": "string" }, "defaultDiskSizeGb": { "type": "string", "description": "[Output Only] Server-defined default disk size in GB.", "format": "int64" }, "description": { "type": "string", "description": "[Output Only] An optional description of this resource." }, "zone": { "type": "string", "description": "[Output Only] URL of the zone where the disk type resides. You must specify this field as part of the HTTP request URL. It is not settable as a field in the request body." }, "region": { "type": "string", "description": "[Output Only] URL of the region where the disk type resides. Only applicable for regional resources. You must specify this field as part of the HTTP request URL. It is not settable as a field in the request body." }, "kind": { "type": "string", "description": "[Output Only] Type of the resource. Always compute#diskType for disk types.", "default": "compute#diskType" }, "deprecated": { "$ref": "DeprecationStatus", "description": "[Output Only] The deprecation status associated with this disk type." }, "creationTimestamp": { "type": "string", "description": "[Output Only] Creation timestamp in RFC3339 text format." } }, "description": "Represents a Disk Type resource. Google Compute Engine has two Disk Type resources: LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh [Regional](/compute/docs/reference/rest/alpha/regionDiskTypes) LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh [Zonal](/compute/docs/reference/rest/alpha/diskTypes) You can choose from a variety of disk types based on your needs. For more information, read Storage options. The diskTypes resource represents disk types for a zonal persistent disk. For more information, read Zonal persistent disks. The regionDiskTypes resource represents disk types for a regional persistent disk. For more information, read Regional persistent disks." }, "NetworkEndpointGroupServerlessDeployment": { "id": "NetworkEndpointGroupServerlessDeployment", "description": "Configuration for a serverless network endpoint group (NEG). The platform must be provided. Note: The target backend service must be in the same project and located in t