ntication. USE_ORIGIN: Principal will be set to the identity from origin authentication.", "enumDescriptions": [ "", "Principal will be set to the identity from origin authentication.", "Principal will be set to the identity from peer authentication." ], "type": "string", "enum": [ "INVALID", "USE_ORIGIN", "USE_PEER" ] }, "origins": { "items": { "$ref": "OriginAuthenticationMethod" }, "type": "array", "description": "List of authentication methods that can be used for origin authentication. Similar to peers, these will be evaluated in order the first valid one will be used to set origin identity. If none of these methods pass, the request will be rejected with authentication failed error (401). Leave the list empty if origin authentication is not required." }, "peers": { "description": "List of authentication methods that can be used for peer authentication. They will be evaluated in order the first valid one will be used to set peer identity. If none of these methods pass, the request will be rejected with authentication failed error (401). Leave the list empty if peer authentication is not required.", "items": { "$ref": "PeerAuthenticationMethod" }, "type": "array" }, "serverTlsContext": { "description": "Configures the mechanism to obtain server-side security certificates and identity information.", "$ref": "TlsContext" } }, "description": "[Deprecated] The authentication settings for the backend service. The authentication settings for the backend service.", "id": "AuthenticationPolicy" }, "FirewallPolicyRuleMatcher": { "type": "object", "properties": { "destThreatIntelligences": { "type": "array", "items": { "type": "string" }, "description": "Names of Network Threat Intelligence lists. The IPs in these lists will be matched against traffic destination." }, "destIpRanges": { "type": "array", "items": { "type": "string" }, "description": "CIDR IP address range. Maximum number of destination CIDR IP ranges allowed is 5000." }, "srcIpRanges": { "type": "array", "d